import React from 'react';

const Services = () => {
  return (
    <div className="container">
      <h1>Our Services</h1>
      <p>
        At BachaGroup, we offer a variety of services tailored to meet your needs. Our core services include but are not limited to:
      </p>
      <ul>
        <li>Consulting</li>
        <li>Project Management</li>
        <li>Technology Solutions</li>
        <li>Event Organization</li>
      </ul>
      <p>
        Stay tuned for more details as we expand our services to serve you better!
      </p>
    </div>
  );
};

export default Services;
